function Form(){
    const[name,setname]=useState("");
    const[age,setage]=useState("");
    const[email,setemail]=useState("");



    function Submitfun(e){
        e.priventDefault();
        console.log("Form Submitted!!");
        console.log("Corrent State",name,age,email);
    }
    return(
        <>
        <form onSubmit={Submitfun}>
            <label>Enter Your Name <input type="text" onChange={(e)=>{setname(e.target.value)}}></input></label><br/>
            <label>Enter Your Age <input type="text" onChange={(e)=>{setage(e.target.value)}}></input></label><br/>
            <label>Enter Your EmailID <input type="text" onChange={(e)=>{set(e.target.value)}}></input></label><br/>
            <input type="submit" value="Submit"></input>     
        </form>
        
        </>
    );
}
export default Form;
